import React from "react";

const Restaurent = (props) => {
const {restaurent}  =props;
    return (
        <div className="row">
            {
                restaurent.map(rest => (
                <ul>
                <div class="col-md-4" text-align="right">
                        <div class="card" py-2>
                            <div class="card-body">
                                <h4>{rest.data}</h4>
                                <li key={rest.id}>
                                   Name: {rest.name} Location: {rest.location}
                                </li>
                            </div>
                        </div>
                        <br></br>

                    </div>
                </ul>

                ))
                
            }

        </div>
    );
};
export default Restaurent;
